I got an error about libprocps3 when installing procps. This fixed that:

```sudo -S wget http://mirrors.kernel.org/ubuntu/pool/main/p/procps/libprocps3_3.3.9-1ubuntu2_amd64.deb;
 sudo -S dpkg -i libprocps3_3.3.9-1ubuntu2_amd64.deb```

